import com.sun.xml.internal.fastinfoset.util.CharArray;

/**
 * Implement strStr().
 * <p>
 * Return the index of the first occurrence of needle in haystack, or -1 if needle is not part of haystack.
 * <p>
 * Example 1:
 * <p>
 * Input: haystack = "hello", needle = "ll"
 * Output: 2
 * Example 2:
 * <p>
 * Input: haystack = "aaaaa", needle = "bba"
 * Output: -1
 * Clarification:
 * <p>
 * What should we return when needle is an empty string? This is a great question to ask during an interview.
 * <p>
 * For the purpose of this problem, we will return 0 when needle is an empty string. This is consistent to C's strstr() and Java's indexOf().
 */

public class LC28_Implement_strStr {


    public int strStr(String haystack, String needle) {
//        return haystack.indexOf(needle); // is equivalent in java

        if (needle.isEmpty()) {
            return 0;
        }

//        return strStrWithDP(haystack.toCharArray(), needle.toCharArray());

        return kmpPatternSearch(haystack.toCharArray(), needle.toCharArray());
    }

    //O(haystackLenght + needleLenght)
    private int kmpPatternSearch(char[] hayStack, char[] needle) {


        // Create a table which gives longest prefix == longest suffix at given point j, for skipping the comparison of such case
        int[] prefixSuffixInformationTable = createPrefixSuffixInformationTable(needle);

        int i = 0, j = 0;


        while (i < hayStack.length) {

            if (hayStack[i] == needle[j]) {

                i++;
                j++;

            }

            if (j == needle.length) { // it means needle is found, return the point where first character matches
                return i - j;
            } else if (i < hayStack.length && hayStack[i] != needle[j]) {

                // as j is 0 and no match and so no prefix, check next character in haystack
                if (j == 0) {
                    i++;

                } else {

                    // skip the required  suffix which is already a prefix.
                    j = prefixSuffixInformationTable[j - 1];
                }
            }


        }


        return -1;
    }

    private int[] createPrefixSuffixInformationTable(char[] needle) {

        int[] table = new int[needle.length];


        int len = 0; //
        table[0] = 0; // for first character length of prefix will be zero


        int i = 1;
        while (i < needle.length) {

            if (needle[len] == needle[i]) {  // if matches,
                len++;  //len of prefix will increment by one.
                table[i] = len; // update the table
                i++;    // move ahead
            } else {

                if (len == 0) { //
                    table[i] = 0; // as len == 0 and no character match so length of prefix will be zero
                    i = i + 1;    //move ahead
                } else {
                    len = table[len - 1]; // as len was not zero and character does not match,
                    // move back to previous suffix length
                    // i will eb compared with previous suffix
                }


            }
        }

        return table;


    }


    //O(n2) space and time both, failed with memory limit on leetcode
    private int strStrWithDP(char[] haystack, char[] needle) {

        boolean[][] dp = new boolean[needle.length][haystack.length];

        for (int i = 0; i < needle.length; i++) {

            for (int j = i; j < haystack.length; j++) {

                if (needle[i] == haystack[j]) {

                    dp[i][j] = true;

                    if (i >= 1 && j >= 1) {
                        dp[i][j] = dp[i][j] && dp[i - 1][j - 1];
                    }

                }

            }
        }

        for (int j = needle.length - 1; j < haystack.length; j++) {
            if (dp[needle.length - 1][j]) {
                return j - needle.length + 1;
            }
        }

        return -1;
    }


    public static void main(String[] args) {
        LC28_Implement_strStr strStr = new LC28_Implement_strStr();

        System.out.println(strStr.strStr("hello", "ll"));
        System.out.println(strStr.strStr("kakakako", "kakako"));
        String haystack = "";
        String needle = "";
        System.out.println(strStr.strStr(
                haystack,
                needle));

        System.out.println(haystack.indexOf(needle));

    }

}
